require.config({"config": {
        "text":{"Magento_Ui/templates/grid/filters/filters.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"data-grid-filters-actions-wrap\" collapsible=\"openClass: false, closeOnOuter: false\">\n    <div class=\"data-grid-filters-action-wrap\">\n        <button class=\"action-default\" data-action=\"grid-filter-expand\" disable=\"!hasVisible()\" translate=\"'Filters'\"\n            css=\"_active: hasVisible() && $collapsible.opened()\"\n            toggleCollapsible></button>\n    </div>\n</div>\n\n<scope args=\"chips\" render=\"\"></scope>\n\n<div class=\"admin__data-grid-filters-wrap\" data-part=\"filter-form\" css=\"_show: hasVisible() && $collapsible.opened()\" keyboard=\"{ 13: apply }\">\n    <fieldset class=\"admin__fieldset admin__data-grid-filters\">\n        <legend class=\"admin__filters-legend\">\n            <span translate=\"'Advanced filter'\"></span>\n        </legend>\n        <fieldset class=\"admin__form-field\" outereach=\"getRanges()\" visible=\"$parent.isFilterVisible($data)\" render=\"\"></fieldset>\n        <div class=\"admin__form-field\" outereach=\"getPlain()\" visible=\"$parent.isFilterVisible($data)\" render=\"\"></div>\n    </fieldset>\n\n    <div class=\"admin__data-grid-filters-footer\">\n        <div class=\"admin__footer-main-actions\">\n            <button class=\"action-tertiary\" type=\"button\" data-action=\"grid-filter-cancel\" click=\"cancel\" closeCollapsible>\n                <span translate=\"'Cancel'\"></span>\n            </button>\n            <button class=\"action-secondary\" type=\"button\" data-action=\"grid-filter-apply\" click=\"apply\" closeCollapsible>\n                <span translate=\"'Apply Filters'\"></span>\n            </button>\n        </div>\n    </div>\n</div>\n"}
}});
